@-moz-document regexp("https?://www\.google(\.com?)?(\.[a-z][a-z])?/(|\?gws_rd.*|\?gfe_rd.*|webhp\?.*)") {
/* Hide the default Google logo */
    #hplogo, .lnXdpd {
        display: none !important;
    }

    .k1zIA.rSk4se {
        background-image: url('https://i.ibb.co/SNjMBBG/output-onlinegiftools-1.gif') !important;
        background-position: center center !important;
        background-repeat: no-repeat !important;
        background-size: 328px 169px !important; /* Adjust the background image size as needed */
        height: 333px !important;
        width: 280px !important;
        display: block !important; /* Ensure the element is displayed */
    }

    /* Add a darker purple and pink radial gradient background */
    body {
        background: radial-gradient(circle, #0a0017, #550055) !important;
    }

    /* Change the color of the About and Store links to neon blue */
    .MV3Tnb {
        color: #1BFFFF !important; /* Neon blue color code */
        text-shadow: 0 0 5px #1BFFFF; /* Add a 5px glow effect */
    }

    /* Change the color of the Gmail and Images links to neon blue */
